import React from 'react';
export const DateParser = (date) => {
    let day = new Date(date);
    let dd = String(day.getDate()).padStart(2, '0');
    let mm = String(day.getMonth() + 1).padStart(2, '0'); //January is 0!
    let yyyy = day.getFullYear();

    // day = mm + '/' + dd + '/' + yyyy;
    day = yyyy + '/' + mm + '/' + dd;
    return day;
}
